func TestSelection (t * testing.T){
	values := [][][]int{
		{{1, 2, 3, 4}, {1, 2, 3, 4}},
		{{2, 3, 6, 4}, {2, 3, 4, 6}},
		{{64, 25, 12,22, 11}, {11, 12, 22, 25, 64}},
	}

	var testCase [][]int
	for _, testCase = range values {
		ans := selection_sort(testCase[0])
		var idx int
		for idx, _ = range ans {
			if ans[idx] != testCase[1][idx] {
				t.Error("Expected:", ans[idx], "Actual:", testCase[1][idx])
			}
		}
	}
}

